import React from 'react'
import Content from './Content'
import Total from './Total'
import Header from './Header'
const Course = ({ course }) => {
  console.log("Course Working");
  return (
    <div>
      <p>Course Working</p>
      <Header course={course} />
      <Content course={course} />
      <Total course={course} />
    </div>
  )
}
export default Course
